import React, { useState, useEffect } from 'react';
import { FiHome, FiPieChart, FiUsers, FiSettings, FiMenu, FiX } from 'react-icons/fi';
import './Dashboard.css';

interface MenuItem {
  icon: React.ReactNode;
  text: string;
  active?: boolean;
}

const Dashboard: React.FC = () => {
  const [isMobile, setIsMobile] = useState<boolean>(false);
  const [isMenuOpen, setIsMenuOpen] = useState<boolean>(false);

  useEffect(() => {
    const handleResize = () => {
      setIsMobile(window.innerWidth <= 992);
      if (window.innerWidth > 992) {
        setIsMenuOpen(false);
      }
    };

    handleResize();
    window.addEventListener('resize', handleResize);
    return () => window.removeEventListener('resize', handleResize);
  }, []);

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  const menuItems: MenuItem[] = [
    { icon: <FiHome />, text: 'Dashboard', active: true },
    { icon: <FiPieChart />, text: 'Analytics' },
    { icon: <FiUsers />, text: 'Users' },
    { icon: <FiSettings />, text: 'Settings' }
  ];

  return (
    <div className="dashboard">
      {/* Mobile Menu Button */}
      <button 
        className="menu-toggle" 
        onClick={toggleMenu}
        aria-label={isMenuOpen ? 'Close menu' : 'Open menu'}
      >
        {isMenuOpen ? <FiX size={24} /> : <FiMenu size={24} />}
      </button>

      {/* Overlay for Mobile */}
      <div 
        className={`overlay ${isMenuOpen ? 'active' : ''}`} 
        onClick={toggleMenu}
        role="button"
        tabIndex={0}
        aria-label="Close menu"
      />

      {/* Sidebar */}
      <aside className={`sidebar ${isMenuOpen ? 'active' : ''}`}>
        <div className="logo-section">
          <div className="logo">
            <span>D</span>
          </div>
          <h1>Dashboard</h1>
        </div>

        <div className="sidebar-header">
          <h2>Main Menu</h2>
        </div>

        <nav>
          <ul>
            {menuItems.map((item, index) => (
              <li key={index}>
                <a 
                  href="#" 
                  className={item.active ? 'active' : ''}
                  onClick={(e) => {
                    if (isMobile) {
                      toggleMenu();
                    }
                    e.preventDefault();
                  }}
                >
                  <span className="icon">{item.icon}</span>
                  <span className="text">{item.text}</span>
                </a>
              </li>
            ))}
          </ul>
        </nav>

        <div className="sidebar-footer">
          <div className="user-profile">
            <div className="avatar">JD</div>
            <div className="user-info">
              <span className="name">John Doe</span>
              <span className="role">Admin</span>
            </div>
          </div>
        </div>
      </aside>

      {/* Main Content */}
      <main className="content">
        <h2>Welcome to Dashboard</h2>
        <p>This is the main content area. Resize the browser to see the responsive behavior.</p>

        <div className="stats-grid">
          <div className="stat-card">
            <h3>Total Users</h3>
            <p>1,248</p>
          </div>
          <div className="stat-card">
            <h3>Revenue</h3>
            <p>$24,780</p>
          </div>
          <div className="stat-card">
            <h3>Active Projects</h3>
            <p>18</p>
          </div>
        </div>
      </main>
    </div>
  );
};

export default Dashboard;
